CREATE EXTENSION IF NOT EXISTS postgis;
CREATE EXTENSION IF NOT EXISTS postgis_topology;
-- Reconnect to update pg_setting.resetval
-- See https://github.com/postgis/docker-postgis/issues/288
\c
CREATE EXTENSION IF NOT EXISTS fuzzystrmatch;
CREATE EXTENSION IF NOT EXISTS postgis_tiger_geocoder;


CREATE TABLE public.pump_stations (
    id integer NOT NULL,
    geom public.geometry(PointZ,4326),
    "name pump" character varying,
    nrg_sys character varying,
    type character varying,
    area character varying,
    district character varying,
    cost character varying,
    power character varying,
    name_chane character varying,
    activity character varying,
    wgs84_y double precision,
    wgs84_x double precision,
    rem character varying,
    pump_stations_pkey integer,
    layer character varying,
    path character varying,
    ngr_sys character varying
);


CREATE SEQUENCE public.pump_stations_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


